export class Util {
  /**
   * checks if this is a literal basic object {} as distinct from a build in one (e.g. new Map)
   * @param thing
   */
  static isLiteralObject(thing) {
    return (
      thing !== null &&
      typeof thing === 'object' &&
      Object.getPrototypeOf(thing) === Object.prototype
    );
  }

  /**
   * glues together object values as a string
   * @param obj
   * @param keySeparator
   * @param valueSeparator
   */
  static objectJoin(obj, keySeparator = ':', valueSeparator = ';') {
    let objectParts = [];
    Object.keys(obj).forEach((key) => {
      objectParts.push(key + keySeparator + obj[key]);
    });
    return objectParts.join(valueSeparator);
  }

  static objectJoinValues;

  /**
   * return the first non-null argument (similar to mysql's coalesce)
   * @param args
   */
  static coalesce(...args) {
    for (let idx = 0; idx < args.length; idx++) {
      if (args[idx] !== null && typeof args[idx] !== 'undefined') {
        return args[idx];
      }
    }
    return null;
  }

  /**
   * given an array of objects each of which has a set of keys combine them into a single object
   *
   * for example:
   * [
   *   {
   *     key1: thing,
   *     key2: thing,
   *   },
   *   {
   *     key3: thing,
   *     key4: thing,
   *   },
   * ]
   * becomes:
   * {
   *     key1: thing,
   *     key2: thing,
   *     key3: thing,
   *     key4: thing
   * }
   * @param args
   */
  static combineArrayOfObjects(...args) {
    const result = {};
    for (let idx = 0; idx < args.length; idx++) {
      const obj = args[idx];
      const keys = Object.keys(obj);
      for (let keyIdx = 0; keyIdx < keys.length; keyIdx++) {
        const key = keys[keyIdx];
        result[key] = obj[key];
      }
    }
    return result;
  }

  /**
   * try to extract a column of data from an array of objects or an object of objects
   * somewhat akin to PHP's array_column
   * @param data
   * @param columnName
   * @param failIfNotFound
   */
  static column(data, columnName, failIfNotFound = true) {
    const results = [];
    Object.values(data).forEach((row) => {
      if (columnName in row) {
        results.push(row[columnName]);
      } else if (failIfNotFound) {
        throw "Failed to find '" + columnName + "' in all the rows";
      } else {
        results.push(null);
      }
    });
    return results;
  }

  /**
   * create an object of objects in a number of ways, somewhat akin to PHP's
   * - if useValues is null (or unset) then useKeys provides both keys and values
   * - if useValues is a function then it's used as a callback on each of useKeys
   * - otherwise useValues must have the same length as useKeys and they are combined
   * @param useKeys
   * @param useValues
   */
  static combine(useKeys, useValues = null) {
    const result = {};
    const keys = Object.values(useKeys);
    if (useValues === null) {
      keys.forEach((key) => {
        result[key] = key;
      });
    } else if (typeof useValues === 'function') {
      keys.forEach((key) => {
        result[key] = useValues(key);
      });
    } else {
      const values = Object.values(useValues);
      if (values.length !== useKeys.length) {
        throw 'useKeys & useValues must contain the same number of elements';
      } else {
        for (let idx = 0; idx < keys.length; idx++) {
          result[keys[idx]] = values[idx];
        }
      }
    }
    return result;
  }

  /**
   * Filters an array of data
   * This behaves similarly to the native filter function but allows for dynamic object keys
   * @param data - The data to filter
   * @param filters - An array of filters to apply
   */
  static filter(data, filters) {
    const matchedData = [];
    for (let x = 0; x < data.length; x++) {
      let matches = 0;
      for (const [filterKey, filterValue] of Object.entries(filters)) {
        const objectPropertyValue = data[x][filterKey];
        if (typeof objectPropertyValue == 'string' && objectPropertyValue.length > 0) {
          if (objectPropertyValue.toUpperCase().includes(filterValue.toUpperCase())) {
            matches++;
          }
        } else if (filterValue && objectPropertyValue === filterValue) {
          matches++;
        }
      }
      if (matches === Object.keys(filters).length) {
        matchedData.push(data[x]);
      }
    }
    return matchedData;
  }

  /**
   * Filters a Record set of data
   * @param data
   * @param filters
   */
  static filterRecord(data, filters) {
    const matchedData = {};
    const dataKeys = Object.keys(data);
    for (let idx = 0; idx < dataKeys.length; idx++) {
      let matches = 0;
      for (const [filterKey, filterValue] of Object.entries(filters)) {
        const objectPropertyValue = data[dataKeys[idx]][filterKey];
        if (typeof objectPropertyValue == 'string' && objectPropertyValue.length > 0) {
          if (objectPropertyValue.toUpperCase().includes(filterValue.toUpperCase())) {
            matches++;
          }
        } else if (filterValue && objectPropertyValue === filterValue) {
          matches++;
        }
      }
      if (matches === Object.keys(filters).length) {
        matchedData[dataKeys[idx]] = data[dataKeys[idx]];
      }
    }
    return matchedData;
  }

  /**
   * more accurate isString test (by one of the authors of lodash)
   * https://stackoverflow.com/questions/4059147/check-if-a-variable-is-a-string-in-javascript
   * @param thing
   */
  static isString(thing) {
    return Object.prototype.toString.call(thing) === '[object String]';
  }

  /**
   *
   * @param func
   * @param wait
   * @param immediate whether to run immediately
   * @returns {(function(): void)|*}
   */
  static debounce(func, wait, immediate) {
    let timeout;
    return function () {
      const context = this,
        args = arguments;
      const later = function () {
        timeout = null;
        if (!immediate) func.apply(context, args);
      };
      const callNow = immediate && !timeout;
      clearTimeout(timeout);
      timeout = setTimeout(later, wait);
      if (callNow) func.apply(context, args);
    };
  }

  /**
   * @param objectThing object
   * @returns {*[]}
   */
  static trueObjectKeysToArray(objectThing) {
    if (typeof objectThing !== 'object' || objectThing === null) {
      throw new TypeError('defaultThing must be a literal object');
    }
    return Object.keys(objectThing).filter((key) => objectThing[key]);
  }

  /**
   * @param thing string|object|array
   * @param defaultThing  string|object|array
   * @returns {*|*[]|string}
   * @throws TypeError
   */
  static ensureDefault(thing, defaultThing) {
    if (
      thing === null ||
      !(this.isString(thing) || Array.isArray(thing) || typeof thing === 'object')
    ) {
      throw new TypeError("'thing' must be a string, array or object");
    }
    if (
      defaultThing === null ||
      !(
        this.isString(defaultThing) ||
        Array.isArray(defaultThing) ||
        typeof defaultThing === 'object'
      )
    ) {
      throw new TypeError("'defaultThing' must be a string, array or object");
    }
    let useThing, useDefaultThing;
    if (this.isString(thing)) {
      useThing = thing.split(' ');
    } else if (typeof thing === 'object') {
      useThing = Util.trueObjectKeysToArray(thing);
    } else {
      useThing = thing;
    }
    if (this.isString(defaultThing)) {
      useDefaultThing = defaultThing.split(' ');
    } else if (typeof thing === 'object') {
      useDefaultThing = Util.trueObjectKeysToArray(thing);
    } else {
      useDefaultThing = defaultThing;
    }
    let resultArray = Array.from(new Set([...useThing, ...useDefaultThing]));
    if (this.isString(thing)) {
      return resultArray.join(' ');
    } else if (Array.isArray(thing)) {
      return resultArray;
    } else {
      let resultObject = {};
      resultArray.forEach((item) => {
        resultObject[item] = true;
      });
      return resultObject;
    }
  }

  /**
   * naive snake case converter
   * @param str
   * @returns {string}
   */
  static snakeCase(str) {
    return str.toLowerCase().replaceAll(' ', '-');
  }

  /**
   * naive snake case decoder
   * @param str
   * @returns {string}
   */
  static humaniseSnakeCase(str) {
    const parts = str.split('-');
    const rebuild = [];
    parts.forEach((part) => {
      rebuild.push(part.slice(0, 1).toUpperCase() + part.slice(1).toLowerCase());
    });
    return rebuild.join(' ');
  }

  /**
   *
   * @param thing
   * @param dp
   * @returns {number}
   */
  static toFixed(thing, dp = 0) {
    let value;
    if (this.isString(thing)) {
      value = parseFloat(thing);
      if (isNaN(value)) {
        throw "'" + thing + "' is not a valid number";
      }
    } else if (typeof thing === 'number') {
      value = thing;
    } else {
      throw 'toFixed only works with numbers and strings';
    }
    let multiplier = Math.pow(10, dp);
    return Math.round((value + Number.EPSILON) * multiplier) / multiplier;
  }

  static toFixedDisplay(thing, dp = 0) {
    const rounded = this.toFixed(thing, dp);
    return rounded.toFixed(dp);
  }

  static getPlaceholderBookImage(idx) {
    //idx = Math.max(idx % 6, 0);
    switch (idx) {
      case 0:
        return `data:image/png;base64,`;
      case 1:
        return `data:image/png;base64,`;
      case 2:
        return `data:image/png;base64,`;
      case 3:
        return `data:image/png;base64,`;
      case 4:
        return `data:image/png;base64,`;
      case 5:
        return 'data:image/png;base64,';

      case 6:
        return 'data:image/jpeg;base64,';

      case 7:
        return 'data:image/jpeg;base64,';

      case 8:
        return 'data:image/jpeg;base64,';

      default:
        return 'data:image/jpeg;base64,';
    }
  }

  /**
   * @see https://stackoverflow.com/questions/46155/how-can-i-validate-an-email-address-in-javascript#answer-46181
   */
  static validateEmail = (email) => {
    return String(email)
      .toLowerCase()
      .match(
        /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|.(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/
      );
  };

  /**
   * get random elements from an array
   * @param arr
   * @param n
   * @returns {any[]}
   */
  static getRandom = (arr, n) => {
    const result = new Array(n);
    let len = arr.length;
    const taken = new Array(len);
    if (n > len) throw new RangeError('getRandom: more elements taken than available');
    while (n--) {
      var x = Math.floor(Math.random() * len);
      result[n] = arr[x in taken ? taken[x] : x];
      taken[x] = --len in taken ? taken[len] : len;
    }
    return result;
  };

  static randomIntFromInterval = (min, max) => {
    // min and max included
    return Math.floor(Math.random() * (max - min + 1) + min);
  };

  /**
   * upgrades a url from http to https
   * @param url
   * @returns {*|string}
   */
  static ensureSsl = (url) => {
    if (url.startsWith('http://')) {
      return 'https://' + url.substring(7);
    } else {
      return url;
    }
  };

  static unique(arr) {
    return arr.filter((value, index, array) => array.indexOf(value) === index);
  }
}
